import React from "react";
import "./../styles/Sidebar.css"; // Import the CSS

function Sidebar() {
  return (
    <div className="sidebar">
      <h2>Admin Dashboard</h2>
      <ul>
        <li>Admin Profile</li>
        <li>Student</li>
        <li>Company</li>
        <li>Analysis</li>
      </ul>
    </div>
  );
}

export default Sidebar;
